#time & space check

def analyze(func, *args):
    import time, tracemalloc

    tracemalloc.start()
    start = time.perf_counter()

    func(*args)

    end = time.perf_counter()
    current, peak = tracemalloc.get_traced_memory()
    tracemalloc.stop()

    return {
        "time_seconds": end - start,
        "memory_bytes": peak
    }

